import React from "react";
import "./About.css";
import Environment from "./environment/Environment";
import History from "./history/History";

const About = () => {
  return (
    <main className="about">
      <History />
      <Environment
        title1={"Bringing Russia to you"}
        subtitle1={"Authenticity at it's finest"}
        desc1={" From the design to the final crafting of a knife, many work techniques are used — the processing of steel, of course, but also that of wood, horn, or precious metals. It is the combination of these particular techniques that gives Ceccaldi knife-makers this unique know-how."}
        title2={"Bringing Russia to you"}
        subtitle2={"Authenticity at it's finest"}
      />
    </main>
  );
};

export default About;
